var title_f2_0_2048="Osteitis in congenital syphilis";
var content_f2_0_2048=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PEDS%2F74323&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PEDS%2F74323&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Congenital syphilis: Osteitis",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 432px; height: 304px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Note the extensive destruction, with metaphyseal (arrows) and diaphyseal radiolucencies throughout the humerus, radius, and ulna. Observe the exuberant periosteal overgrowth, with expansile deformity of the bones of the upper extremity. Syphilitic granulation tissue may extend from the metaphysis to the diaphysis, creating an extension of the infectious focus. Reactive sclerosis often surrounds the osteolytic lesions, with associated periostitis of the long tubular bones.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced with permission from: Yochum TR, Rowe LJ. Yochum And Rowe's Essentials of Skeletal Radiology, 3rd ed. Lippincott Williams &amp; Wilkins, Philadelphia 2004. Copyright &copy; 2004 Lippincott Williams &amp; Wilkins.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
