" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    CT of preinvasive lesion - AAH or AIS",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 333px; height: 353px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    CT of preinvasive lesion (AAH or AIS). Axial 2-mm image through the left upper lobe shows a 5-mm pure ground-glass nodule (GGN), which has remained stable for 8 years (arrow). AAH and AIS can be single or multiple.",
"    <div class=\"footnotes\">",
"     AHH: atypical adenomatous hyperplasia; AIS: adenocarcinoma in situ.",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced with permission from: Travis WD, Brambilla E, Noguchi M, et al. International Association for the Study of Lung Cancer/American Thoracic Society/European Respiratory Society International Multidisciplinary Classification of Lung Adenocarcinoma. J Thorac Oncol 2011; 6:244. Copyright &copy; 2011 Lippincott Williams &amp; Wilkins.",
"    </div>",
"   </div>",
