" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 540px\">",
"   <div class=\"ttl\">",
"    Synovial osteochondromatosis of the knee",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 520px; height: 406px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    These anteroposterior and lateral views of the knee demonstrate multiple calcified intraarticular loose bodies (arrows) consistent with synovial osteochondromatosis. Also noted is severe medial and lateral joint space narrowing and osteophyte formation consistent with concomitant osteoarthritis of the knee joint.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
