var title_f2_0_2059="Muscle tone in colic PI";
var content_f2_0_2059=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PI%2F76502&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PI%2F76502&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Symptoms of increased muscle tone in babies with colic",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td>",
"        The baby's face is red, and the skin around the mouth is pale",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        The belly is bulging and hard",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        The legs are drawn into the belly, and the feet are cold. (The legs can also be straight out when the baby cries especially hard.)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        The fingers are clenched shut",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        The arms are stiff, tight, and straight. (The elbows can also be bent.)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        The back is arched",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Adapted from: Lester BM. Colic and Excessive Crying. Report of the 105th Ross Conference on Pediatric Research, Lester BM, Barr RG (Eds), Ross Products Division, Columbus, OH, 1997. p.18.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
