var title_f2_0_2060="Low-fat low-sugar guide B";
var content_f2_0_2060=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PEDS%2F81884&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PEDS%2F81884&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Tips for maintaining a healthy weight: Low-fat, low-sugar eating guidelines",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <colgroup width=\"20%\">",
"     </colgroup>",
"     <colgroup span=\"2\" width=\"40%\">",
"     </colgroup>",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Food group",
"       </td>",
"       <td class=\"subtitle1\">",
"        Food to choose more often",
"       </td>",
"       <td class=\"subtitle1\">",
"        Food to limit",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Fats",
"       </td>",
"       <td>",
"        Almonds, avocado, canola oil; fat-free or reduced-fat margarine, mayonnaise and salad dressings; olives, olive oil, peanut butter, peanuts, sunflower seeds, walnuts",
"       </td>",
"       <td>",
"        Bacon, butter, chitterlings, coconut; cream (half and half, whipped cream), cream cheese, saturated fats such as coconut, palm and palm kernel oils; shortening or lard, sour cream",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Sweets",
"       </td>",
"       <td>",
"        Sugar substitutes such as Equal, Sweet 'n Low, or Splenda; light or sugar-free syrups, light or low-sugar jams and jellies; sugar-free gelatin; sugar-free Popsicles",
"       </td>",
"       <td>",
"        Candy, sugar, syrup, honey, jam, jelly, gelatin, Popsicles and fruit juice bars, fruit snacks and fruit leather",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Beverages",
"       </td>",
"       <td>",
"        Water, diet sodas, sugar-free drink mixes, sugar-free flavored water, unsweetened iced tea, coffee",
"       </td>",
"       <td>",
"        Regular sodas, fruit juices, sports drinks, drink mixes, sweet tea, and flavored coffee beverages",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Miscellaneous",
"       </td>",
"       <td>",
"        Catsup, mustard, pickles, salsa, spices, lemon juice",
"       </td>",
"       <td>",
"        &nbsp;",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Snacks (in very limited amounts)",
"       </td>",
"       <td>",
"        Low-fat popcorn, pretzels, baked or low-fat chips, rice cakes, graham crackers, granola bars, fat-free and low-fat frozen yogurt, fat-free fudge bars, homemade fruit smoothies",
"       </td>",
"       <td>",
"        Chips, buttered popcorn; store bought cakes, cookies and pies; chocolate, sherbet, ice cream, pudding",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Texas Children's Hospital.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
