var title_f2_0_2061="ROHHADNET syndrome";
var content_f2_0_2061=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PEDS%2F88393&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PEDS%2F88393&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Clinical manifestations of ROHHADNET syndrome",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        &nbsp;",
"       </td>",
"       <td class=\"subtitle1\">",
"        Percent of cases",
"       </td>",
"      </tr>",
"      <tr>",
"       <td colspan=\"2\">",
"        <strong>",
"         Hypothalamic endocrine manifestations",
"        </strong>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Early and rapid onset obesity",
"       </td>",
"       <td class=\"centered\">",
"        <strong>",
"         100",
"        </strong>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Deceleration of growth rate",
"       </td>",
"       <td class=\"centered\">",
"        38",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Failed growth hormone stimulation test",
"       </td>",
"       <td class=\"centered\">",
"        <strong>",
"         62",
"        </strong>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Adrenal insufficiency",
"       </td>",
"       <td class=\"centered\">",
"        29",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Cushing's syndrome",
"       </td>",
"       <td class=\"centered\">",
"        5",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Hypernatremia*",
"       </td>",
"       <td class=\"centered\">",
"        <strong>",
"         62",
"        </strong>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Diabetes insipidus",
"       </td>",
"       <td class=\"centered\">",
"        24",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Hyperprolactinemia",
"       </td>",
"       <td class=\"centered\">",
"        52",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Hypogonadotropic hypogonadism",
"       </td>",
"       <td class=\"centered\">",
"        43",
"       </td>",
"      </tr>",
"      <tr class=\"divider_bottom\">",
"       <td class=\"indent1\">",
"        Precocious puberty",
"       </td>",
"       <td class=\"centered\">",
"        10",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <strong>",
"         Respiratory manifestations",
"        </strong>",
"        <sup>",
"         &bull;",
"        </sup>",
"       </td>",
"       <td class=\"centered\">",
"        <strong>",
"         100",
"        </strong>",
"       </td>",
"      </tr>",
"      <tr class=\"divider_bottom\">",
"       <td class=\"indent1\">",
"        Cardiorespiratory arrest",
"       </td>",
"       <td class=\"centered\">",
"        57",
"       </td>",
"      </tr>",
"      <tr class=\"divider_bottom\">",
"       <td>",
"        <strong>",
"         Autonomic dysregulation",
"        </strong>",
"       </td>",
"       <td class=\"centered\">",
"        52",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <strong>",
"         Tumors of neural crest origin",
"        </strong>",
"       </td>",
"       <td class=\"centered\">",
"        52",
"       </td>",
"      </tr>",
"      <tr class=\"divider_bottom\">",
"       <td class=\"indent1\">",
"        Adrenal ganglioneuroma",
"       </td>",
"       <td class=\"centered\">",
"        29",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <strong>",
"         Neurobehavioral disorders",
"        </strong>",
"       </td>",
"       <td class=\"centered\">",
"        48",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     ROHHADNET: rapid onset obesity, hypothalamic dysfunction, hypoventilation, autonomic dysregulation, and neural crest tumors.",
"     <br/>",
"     * In this case, hypernatremia was defined as consistent blood sodium concentrations of &gt;145 mEq/L (which is &gt;2 SD for age). Paradoxically, some patients have hyponatremia.",
"     <br/>",
"     <span class=\"bullet\">",
"      &bull;",
"     </span>",
"     Respiratory manifestations typically consist of hypercarbia and hypoxemia during wakefullness, sometimes associated with cyanotic episodes.",
"    </div>",
"    <div class=\"reference\">",
"     Data from:",
"     <br/>",
"     <ol>",
"      <li>",
"       Bougneres P, Pantalone L, Linglart A, et al. Endocrine manifestations of the rapid-onset obesity with hypoventilation, hypothalamic, autonomic dysregulation, and neural tumor syndrome in childhood. J Clin Endocrinol Metab 2008; 93 (10):3971-3980.",
"      </li>",
"      <li>",
"       Ize-Ludlow D, Gray JA, Sperling MA, et al. Rapid onset obesity with hypothalamic dysfunction, hypoventilation, and autonomic dysregulation presenting in childhood. Pediatrics 2007; 120:e179.",
"      </li>",
"     </ol>",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
