var title_f2_0_2062="PEG rHuMGDF after chemotherapy";
var content_f2_0_2062=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=HEME%2F74521&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=HEME%2F74521&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 487px\">",
"   <div class=\"ttl\">",
"    PEG-rHuMGDF stimulates platelet recovery after chemotherapy",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 467px; height: 312px; background-image: url(data:image/gif;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Patients with lung cancer were treated with paclitaxel and carboplatin on day 1 and subsequently with either placebo (blue open circles, n = 12) or various doses of PEG-rHuMGDF (red closed circles, n = 38) and the platelet counts measured daily. The administration of PEG-rHuMGDF was associated with accelerated recovery of the platelet count. Twenty-one days after administration of the chemotherapy, 93 percent of the PEG-rHuMGDF-treated patients but none of those given placebo had recovered to their baseline platelet values (inset).",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Data from Fanucchi, M, Glaspy, J, Crawford, J, et al, N Engl J Med 1997; 336:404.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
